import React from "react";
import { useNavigate } from "react-router-dom";

function UpdateEvent() {
    const navigate = useNavigate();

    return (
        <div>
            <h1>Update Event</h1>
            <button onClick={() => navigate("/dashboard")}>Back to Dashboard</button>
        </div>
    );
}

export default UpdateEvent;
